import './marks-card.styles.css'
const MarksCard = ({sem}) => {
    return(
        <div className="marks-card">
         {
           Object.keys(sem).map(se =>{
            return <div>
            <h4>{se}</h4>
                <h2>{sem[se][0]}</h2>
            </div> 
           })
         }
         </div>
    
    )
}

export default MarksCard
